import React from "react";
import Todo from "./Todo";

//Creating a function that takes inn a list
export default function TodoList( {todoList, checkTodo} )
{
    return(
        todoList.map(item => {                                                       //Going through every variable in todoList and call each variable "item"
            return <Todo key={item.id} checkTodo={checkTodo} eachTodo={item} />      //Calling Todo function from other file, adding an unique key for each item in the list, passing each item to the function Todo
        })
    )
}
